import axios from "axios";

const URL =
  "https://micro-blogging-dot-full-stack-course-services.ew.r.appspot.com/tweet";

function getData() {
  const tweets = undefined;
  axios.get(URL).then((res) => {
    tweets = res.data.tweets;
  });

  return tweets;
}
